import React, { Component } from 'react';
import './App.css';

import Todo from './components/todo';
import TodoList from './components/todoList';

class App extends Component {
  constructor() {
    super();
    this.state = {
      items: [],
      currentItem: {
        text: '',
        key: ''
      }
    };
  }
  addTodo = e => {
    e.preventDefault();
  };
  render() {
    return (
      <div>
        <div className='todo-container'>
          <Todo addTodo={this.addTodo} />
          <TodoList />
        </div>
      </div>
    );
  }
}

export default App;
